import React, { Component } from 'react'
import { Card } from 'semantic-ui-react'
import { Link,BrowserRouter as Router,Route ,Switch} from 'react-router-dom'
import TenderStatus from '../components/TenderStatus';

export default class TenderLogs extends Component {
 
    constructor(props) {
      super(props);
    }
   
   
  render() {
    return (
      <div className='ui  container center'>
        <h1>TenderLogs</h1>
        <Card>
        <Card.Content>
        <Card.Header>{this.props.address}</Card.Header>
        <Card.Meta>Deployed Tender Address</Card.Meta>
        <Card.Description>
         <Link to='./tenderstatus'>view details</Link> 
        </Card.Description>
      </Card.Content>
      </Card>
    
<Router>
  <Switch>
    <Route exact path="./tenderstatus"  component={TenderStatus}>
     
    </Route>
  </Switch>
</Router>
  
        </div>
    )
  }
}
